            <label htmlFor="email" className="block text-sm font-medium text-gray-700 mb-2">
              Email Address *
            </label>
            <input
              type="email"
              id="email"
              name="email"
              required
              value={formData.email}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
              placeholder="your.email@example.com"
            />
          </div>

          {/* Question 1 */}
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              1. What type of budgeting app are you looking for?
            </label>
            <div className="space-y-2">
              {['Budgeting app', 'Expense tracker', 'Investment tracker', 'All-in-one finance app'].map((option) => (
                <label key={option} className="flex items-center">
                  <input
                    type="radio"
                    name="q1"
                    value={option}
                    checked={formData.q1 === option}
                    onChange={handleInputChange}
                    className="mr-2"
                  />
                  {option}
                </label>
              ))}
            </div>
          </div>

          {/* Question 2 */}
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              2. What's your biggest expense category?
            </label>
            <div className="space-y-2">
              {['Rent/Housing', 'Food/Groceries', 'Transportation', 'Entertainment', 'School/Books'].map((option) => (
                <label key={option} className="flex items-center">
                  <input
                    type="radio"
                    name="q2"
                    value={option}
                    checked={formData.q2 === option}
                    onChange={handleInputChange}
                    className="mr-2"
                  />
                  {option}
                </label>
              ))}
            </div>
          </div>

          {/* Question 3 */}
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              3. How often do you currently track your expenses?
            </label>
            <div className="space-y-2">
              {['Daily', 'Weekly', 'Monthly', 'Sometimes', 'Never'].map((option) => (
                <label key={option} className="flex items-center">
                  <input
                    type="radio"
                    name="q3"
                    value={option}
                    checked={formData.q3 === option}
                    onChange={handleInputChange}
                    className="mr-2"
                  />
                  {option}
                </label>
              ))}
            </div>
          </div>

          {/* Question 4 */}
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              4. Do you currently stick to a budget?
            </label>
            <div className="space-y-2">
              {['Yes, consistently', 'Mostly', 'Sometimes', 'Rarely', 'No'].map((option) => (
                <label key={option} className="flex items-center">
                  <input
                    type="radio"
                    name="q4"
                    value={option}
                    checked={formData.q4 === option}
                    onChange={handleInputChange}
                    className="mr-2"
                  />
                  {option}
                </label>
              ))}
            </div>
          </div>

          {/* Question 5 */}
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              5. How do you currently split expenses with roommates/friends?
            </label>
            <div className="space-y-2">
              {['Shared apps (Splitwise, Venmo, etc.)', 'Manual calculations', 'One person pays', "We don't split", 'Other'].map((option) => (
                <label key={option} className="flex items-center">
                  <input
                    type="radio"
                    name="q5"
                    value={option}
                    checked={formData.q5 === option}
                    onChange={handleInputChange}
                    className="mr-2"
                  />
                  {option}
                </label>
              ))}
            </div>
          </div>

          {/* Question 6 */}
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              6. How confident are you in managing your finances?
            </label>
            <div className="space-y-2">
              {['Very confident', 'Somewhat confident', 'Neutral', 'Not very confident', 'Not confident at all'].map((option) => (
                <label key={option} className="flex items-center">
                  <input
                    type="radio"
                    name="q6"
                    value={option}
                    checked={formData.q6 === option}
                    onChange={handleInputChange}
                    className="mr-2"
                  />
