            </label>
            <div className="space-y-2">
              {['Mobile App (iOS/Android)', 'Web App', 'Desktop App', 'All platforms', 'Not sure'].map((option) => (
                <label key={option} className="flex items-center">
                  <input
                    type="radio"
                    name="q9"
                    value={option}
                    checked={formData.q9 === option}
                    onChange={handleInputChange}
                    className="mr-2"
                  />
                  {option}
                </label>
              ))}
            </div>
          </div>

          {/* Question 10 */}
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              10. What's your preferred way to input expenses?
            </label>
            <div className="space-y-2">
              {['Bank sync', 'Manual entry', 'Photo receipts', 'Voice input', 'QR codes'].map((option) => (
                <label key={option} className="flex items-center">
                  <input
                    type="radio"
                    name="q10"
                    value={option}
                    checked={formData.q10 === option}
                    onChange={handleInputChange}
                    className="mr-2"
                  />
                  {option}
                </label>
              ))}
            </div>
          </div>

          {/* Question 11 */}
          <div className="mb-6">
            <label htmlFor="q11" className="block text-sm font-medium text-gray-700 mb-2">
              11. What's your biggest financial challenge as a student?
            </label>
            <textarea
              id="q11"
              name="q11"
              rows={3}
              value={formData.q11}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
              placeholder="Tell us about your financial challenges..."
            />
          </div>

          {/* Question 12 */}
          <div className="mb-8">
            <label htmlFor="q12" className="block text-sm font-medium text-gray-700 mb-2">
              12. Any additional features or suggestions?
            </label>
            <textarea
              id="q12"
              name="q12"
              rows={3}
              value={formData.q12}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
              placeholder="What else would you like to see in a budgeting app?"
            />
          </div>

          {/* Submit Button */}
          <div className="text-center">
            {submitStatus === 'error' && (
              <div className="mb-4 p-3 bg-red-100 border border-red-400 text-red-700 rounded">
                There was an error submitting your survey. Please try again.
              </div>
            )}
            <button
              type="submit"
              disabled={isSubmitting}
              className="bg-blue-600 hover:bg-blue-700 disabled:bg-blue-400 text-white font-semibold py-3 px-8 rounded-lg text-lg transition duration-300"
            >
              {isSubmitting ? 'Submitting...' : 'Submit Survey'}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default Survey;
